def correct_bracketing(brackets: str) -> bool:
    stack = []
    for char in brackets:
        if char == "(":
            stack.append("(")
        elif char == ")":
            if len(stack) == 0:
                return False
            else:
                stack.pop()
    return len(stack) == 0

