def encode(message):
    vowels = 'aeiouAEIOU'
    result = ''

    for letter in message:
        if letter.isalpha():
            if letter.lower() in vowels:
                new_letter = chr((ord(letter) + 2 - 97) % 26 + 97)  # Replace vowel with 2 places ahead letter
            else:
                new_letter = letter.swapcase()  # Swap case of letters
        else:
            new_letter = letter

        result += new_letter

    return result

