def prod_signs(arr):
    if len(arr) == 0:
        return None

    sign_product = 1
    result = 0

    for num in arr:
        if num > 0:
            sign_product *= 1
        elif num < 0:
            sign_product *= -1
        result += abs(num)

    return result * sign_product

