def int_to_mini_roman(number):
    if number < 1 or number > 1000:
        return "Number out of bounds"

    numerals = {
        1: 'i', 4: 'iv', 5: 'v', 9: 'ix', 10: 'x',
        40: 'xl', 50: 'l', 90: 'xc', 100: 'c', 400: 'cd',
        500: 'd', 900: 'cm', 1000: 'm'
    }

    result = ''
    for value, numeral in sorted(numerals.items(), reverse=True):
        while number >= value:
            result += numeral
            number -= value

    return result.lower()
